(204,	'2012-10-05 14:02:09',	'chemicalcouk@youtube.com',	'chemical.co.uk',	'ecc19b2704c51d6ac273ff4d9e9c0cb2e6916370',	'ROBOT',	'68c693bc8417c12f127229a82304ef7bf297dc0ffd4eb3a4af7c53098f30d624ac362a85f822d6afe78ccb71d7656b5008641f52388a337beeb4dd3b163a912f',	NULL,	'2020-09-19 20:52:17.520',	'UCrTXpe6gOL7zZdl1wKzPhqw',	11,	NULL,	0,	'Chemical Records Forthcoming Dubstep Channel.\r\n\r\nFeaturing exclusive content and music from in-house labels and selected releases.',	'https://yt3.ggpht.com/a/AATXAJx4zCmDKBvpKUFeJIuv7P0LLgZab0LanBmN5jaJ=s88-c-k-c0x00ffffff-no-rj-mo',	'https://yt3.ggpht.com/a/AATXAJx4zCmDKBvpKUFeJIuv7P0LLgZab0LanBmN5jaJ=s176-c-k-c0x00ffffff-no-rj-mo',	'https://yt3.ggpht.com/a/AATXAJx4zCmDKBvpKUFeJIuv7P0LLgZab0LanBmN5jaJ=s176-c-k-c0x00ffffff-no-rj-mo'),
(207,	'2012-10-05 15:15:32',	'deepervibrations@youtube.com',	'DeeperVibrations',	'ecc19b2704c51d6ac273ff4d9e9c0cb2e6916370',	'ROBOT',	'68c693bc8417c12f127229a82304ef7bf297dc0ffd4eb3a4af7c53098f30d624ac362a85f822d6afe78ccb71d7656b5008641f52388a337beeb4dd3b163a912f',	NULL,	'2020-09-19 20:50:36.035',	'UCUhTyFtH3F5Nt3J82dlx7nQ',	15,	NULL,	0,	'Pure bass music, focused on the deeper, more minimal side of dubstep and drum & bass.\nWe are always open to working with artists and labels that fit our sound, so if you would like to have your music featured on the channel, please do contact us.\nWe are not affiliated with any artists or labels though and we ONLY put music up because we love it, not through offers of money or free merchandise! \nFinally, we do not make any profits- our purpose is simply to spread the music we love for those who appreciate it as much as we do :)\n\nIf you would like your track featured on the channel, please e-mail it to admin@deepervibrations.co.uk or contact us via one of the links below...We\'ll do our best to listen to all tunes and will try and provide some feedback.\n\n\"All matter is merely energy condensed to a slow vibration. We are all one consciousness experiencing itself subjectively. There is no such thing as death, life is only a dream and we are the imagination of ourselves.\" - Bill Hicks.',	'https://yt3.ggpht.com/a/AATXAJwVQpxiDKFh5D_X9nHVSmPEh3sAG2oV0BMJPzFF=s88-c-k-c0x00ffffff-no-rj-mo',	'https://yt3.ggpht.com/a/AATXAJwVQpxiDKFh5D_X9nHVSmPEh3sAG2oV0BMJPzFF=s176-c-k-c0x00ffffff-no-rj-mo',	'https://yt3.ggpht.com/a/AATXAJwVQpxiDKFh5D_X9nHVSmPEh3sAG2oV0BMJPzFF=s176-c-k-c0x00ffffff-no-rj-mo'),
(208,	'2012-10-05 15:16:47',	'quantumdnb@youtube.com',	'QuantumDNB',	'ecc19b2704c51d6ac273ff4d9e9c0cb2e6916370',	'ROBOT',	'68c693bc8417c12f127229a82304ef7bf297dc0ffd4eb3a4af7c53098f30d624ac362a85f822d6afe78ccb71d7656b5008641f52388a337beeb4dd3b163a912f',	NULL,	'2020-09-19 20:50:12.106',	'UC8b7pBkHM72aVmtYcg5zGWw',	12,	NULL,	0,	'An up to date music channel for the latest high quality DnB and Dubstep! Listen and Enjoy!\n\nThis channel is for Promotional use only. If you like a song, go and support it! \n\nVideo designed by:\nhttp://vimeo.com/user7200969\n\nFACEBOOK:\nhttp://www.facebook.com/quantumofficial\n\nTwitter:\nwww.twitter.com/quantumofficial',	'https://yt3.ggpht.com/a/AATXAJxloIqI87NR42HpqtQn89kc7ijEkuz0-dLIstvj=s88-c-k-c0x00ffffff-no-rj-mo',	'https://yt3.ggpht.com/a/AATXAJxloIqI87NR42HpqtQn89kc7ijEkuz0-dLIstvj=s176-c-k-c0x00ffffff-no-rj-mo',	'https://yt3.ggpht.com/a/AATXAJxloIqI87NR42HpqtQn89kc7ijEkuz0-dLIstvj=s176-c-k-c0x00ffffff-no-rj-mo'),
