(210,	'2012-10-07 18:14:17',	'criticalmusic@youtube.com',	'CriticalMusic',	'ecc19b2704c51d6ac273ff4d9e9c0cb2e6916370',	'ROBOT',	'68c693bc8417c12f127229a82304ef7bf297dc0ffd4eb3a4af7c53098f30d624ac362a85f822d6afe78ccb71d7656b5008641f52388a337beeb4dd3b163a912f',	NULL,	'2020-09-19 20:49:41.442',	'UCfYsxyFjsWcmDVGuXC3gzJg',	12,	NULL,	0,	'Conceived by D&B visionary Kasra back in 2002, in a front room in north London, the Critical Music name has since blossomed into one of the most successful independent record labels in the UK today. Grown from a simple idea driven by a commitment to putting out the best music the scene has to offer, it has now become one of the most well respected electronic dance music labels in the UK. Nurturing new talent and releasing some of the freshest breaks and beats from the cream of the scene, it has gone on to build a loyal following around the world driven on by Kasra’s never ending quest to release quality underground bass music.\n\nNot only a record label, the Critical empire now boasts it’s own highly esteemed club nights with a residency at Londons world-renowned fabric night spot, as well as regular branded Critical tour nights across the UK and abroad. Drawing in familiar faces from the world of D&B you can be sure each and every Critical Sound event is programmed to perfection.',	'https://yt3.ggpht.com/a/AATXAJxJLAfy5eJlRLSfIb2gGzcj8Y3AsDdB1cqZuRReZw=s88-c-k-c0x00ffffff-no-rj-mo',	'https://yt3.ggpht.com/a/AATXAJxJLAfy5eJlRLSfIb2gGzcj8Y3AsDdB1cqZuRReZw=s176-c-k-c0x00ffffff-no-rj-mo',	'https://yt3.ggpht.com/a/AATXAJxJLAfy5eJlRLSfIb2gGzcj8Y3AsDdB1cqZuRReZw=s176-c-k-c0x00ffffff-no-rj-mo'),
