(265,	'2013-02-26 00:16:24',	'ondubground@youtube.com',	'ONDUBGROUND',	'ecc19b2704c51d6ac273ff4d9e9c0cb2e6916370',	'ROBOT',	'68c693bc8417c12f127229a82304ef7bf297dc0ffd4eb3a4af7c53098f30d624ac362a85f822d6afe78ccb71d7656b5008641f52388a337beeb4dd3b163a912f',	NULL,	'2020-09-19 20:22:09.159',	'UCNI2PhVEsYO3-nJIUysQZPA',	13,	NULL,	0,	'Créé par deux frères, ODG est né à Tours en France en 2004. Puisant directement son inspiration dans le \"french-dub\" des années 90, le projet se fait connaître peu à peu par ses E.p disponibles en libre téléchargement sur son propre net label Original Dub Gathering (www.odgprod.com) qui comporte de nos jours plus de 40 références en libre partage.\r\n\r\nDepuis 2007  le duo est devenu trio, permettant au groupe de dévoiler une réelle fusion de styles, un live à la fois électronique et instrumental fondé d\'une part sur le \"dub sound system\" à l\'anglaise, et d\'autre part sur le style  \"électro-éthno\" français. Après de nombreux concerts aux cotés d\'artistes internationalement reconnus comme Horace Andy, Mad Professor, Iration Steppa, Dj Aphrodite, Mungos Hifi... , ODG travaille aux côtés de Biga Ranx sur 6 tracks de son premier album On Time.',	'https://yt3.ggpht.com/a/AATXAJyDj9vGbSdg4egQ6GXK-05v_rBPjpyMe9tR9sLWJw=s88-c-k-c0x00ffffff-no-rj-mo',	'https://yt3.ggpht.com/a/AATXAJyDj9vGbSdg4egQ6GXK-05v_rBPjpyMe9tR9sLWJw=s176-c-k-c0x00ffffff-no-rj-mo',	'https://yt3.ggpht.com/a/AATXAJyDj9vGbSdg4egQ6GXK-05v_rBPjpyMe9tR9sLWJw=s176-c-k-c0x00ffffff-no-rj-mo'),
